import React, { useState } from "react";
import { Grid, TextField, Button } from "@material-ui/core";
import axios from "axios";
import "tachyons";
import SearchBar from "./component/search_bar";

const Explorify = ({ auth }) => {
  const { token } = auth;

  return (
    <div className={"App"}>
      <Grid container style={{ padding: 20 }} spacing={1}>
        <Grid item xs={12}>
          <h1 class="measure f3 f2-m f1-l">Hello From Explorify</h1>
        </Grid>
        <Grid item xs={6}>
          <Grid
            item
            xs={12}
            style={{ display: "flex", flexDirection: "row" }}
          ></Grid>
          <SearchBar auth={auth}></SearchBar>
        </Grid>
      </Grid>
    </div>
  );
};

export default Explorify;
